// Get the first binary key dynamically
const binaryKey = Object.keys($input.item.binary || {})[0];
if (!binaryKey) {
  throw new Error("No binary data found on input item.");
}

const binary = $input.item.binary[binaryKey];

// Convert binary to base64
const base64File = binary.data.toString('base64');

// Build JSON payload for Airtable
return [
  {
    json: {
      contentType: binary.mimeType || "image/jpeg",
      file: base64File,
      filename: binary.fileName || "upload.jpg"
    },
    pairedItem: { item: 0 }   // ðŸ”‘ keeps mapping to original input
  }
];

// Get the generated prompt text from the previous node
const promptText = $json.content.parts[0].text;

// Build the complete JSON body for the VEO API
const requestBody = {
  "endpoint": "projects/personalised-mail/locations/us-central1/publishers/google/models/veo-3.0-generate-001",
  "instances": [
    {
      "prompt": promptText
    }
  ],
  "parameters": {
    "aspectRatio": "16:9",
    "sampleCount": 1,
    "durationSeconds": "8",
    "personGeneration": "allow_all",
    "addWatermark": true,
    "includeRaiReason": true,
    "generateAudio": true,
    "resolution": "720p"
  }
};

// Return the final object inside a wrapper
return [
  {
    json: {
      "veoRequestBody": requestBody // <-- Wrapped here
    }
  }
];
